import React from 'react';
import {GoogleMap, LoadScript} from '@react-google-maps/api';

const containerStyle = {
    width: '100%', // Full width of the available space
    height: '100%', // Full height of the available space
};



const center = {
    lat: 30.046981762780838,
    lng: 31.237174094852456
};

function MyGoogleMap() {
    return (
        <LoadScript
            googleMapsApiKey="AIzaSyC3phyjN4feKgzWWAVQOURiVIkvYlSMWLg"
        >
            <GoogleMap
                mapContainerStyle={containerStyle}
                center={center}
                zoom={14}
            >
                {/* You can add markers, polygons, or other map elements here */}
            </GoogleMap>
        </LoadScript>
    );
}

export default MyGoogleMap;
